import { useState } from "react";
import { BrowserRouter, Route } from "react-router-dom";
import { RouterLogin } from "../../login/routes/routerLogin";
import { RouterPerson } from "../../person/routes/routerPerson";
import { RouterMain } from "../components/main/routes/main.routes";
import { ProtectedRoutes } from "./ProtectedRoutes.routes";
export const RouterNavigate = () => {
  const tokenUsers = localStorage.getItem("token");
  const [users, setUsers] = useState<boolean>(false);
  if (tokenUsers) setUsers(true);
  return (
    <BrowserRouter>
      <RouterLogin />
      <ProtectedRoutes users={users}>
        <RouterMain />
      </ProtectedRoutes>
      <ProtectedRoutes users={users}>
        <RouterPerson />
      </ProtectedRoutes>
    </BrowserRouter>
  );
};
